★サッカー日本代表選手と同じモデル・機能搭載のオーセンティックユニフォーム！<br>
<br>
●オーセンティックユニフォームは、サッカー日本代表選手が着用しているユニフォームと同じデザイン、機能の搭載を実現したモデルです。<br>
●円陣をコンセプトにしたユニフォームの背面には、前ユニフォームの象徴である結束の一本線を継承！<br>
選手とサポーターがひとつとなり「円陣」を組んで戦おう！その決意を、ユニフォームに表現しました。<br>
●左胸には試合開始に向けてピッチに広がる選手を表現した11本のラインが施されています。<br>
<br>
■素材　インターロック(ポリエステル100％)<br>
■企画製造販売元：アディダスジャパン株式会社<br>
<br>
