★アディダスのレプリカユニフォーム！<br>
<br>
●サッカー日本代表ホームユニフォームのレプリカモデル！<br>
●アディダスサッカー日本代表ユニフォーム史上、最も濃い"青"を用いたボディー！<br>
●前面に、11人の選手の個性を表す、11本の異なる青で構成されたボーダーを配色！<br>
●中央の赤のラインは12人目のプレーヤーであるサポーターを表現！<br>
●襟裏には2018FIFAワールドカップロシアに導く先導者の象徴として、三本足の烏の羽がプリントされています！<br>
●また、adidasのテクノロジー「climacool（クライマクール）」を採用！体温の上昇に沿って、高通気性繊維がヒートゾーンの熱と汗をすばやく逃がすので、常に体をクールに保てます！<br>
<br>
■素材 ポリエステル100％<br>
■企画製造販売元 アディダスジャパン株式会社<br>
